import React from 'react';
import styled from 'styled-components';

export default function RecipeCard(props) {
  return (
    <li style={ {position: 'relative'} }> 
      <p> 
        { props.title }  
      </p>
      <p> 
        { props.image }  
      </p>
      <p> 
        { props.dishTypes }  
      </p>
      <p> 
        { props.diets }  
      </p>
    </li>
  )
};

const Li = styled.li`
  position: relative; 

  padding: 0px;
  margin: 0px;
  background-color: green;
`;
